import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';
import api from '../services/api';

const Register = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [role, setRole] = useState('user'); // Default role
    const navigate = useNavigate(); // Initialize useNavigate

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            if (role === 'user') {
                await api.registerUser({ username, password });
            } else if (role === 'enterprise') {
                await api.registerEnterprise({ username, password });
            }
            alert(`${role.charAt(0).toUpperCase() + role.slice(1)} registered successfully`);
            navigate('/'); // Navigate to the home page after successful registration
        } catch (error) {
            console.error(error);
            alert(`Error registering ${role}`);
        }
    };

    return (
        <div>
            <Navbar />
            <div className="container mx-auto mt-20">
                <form onSubmit={handleSubmit} className="max-w-md mx-auto bg-white p-6 rounded shadow">
                    <h2 className="text-2xl font-bold mb-4">Register</h2>
                    <input
                        type="text"
                        placeholder="Username"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        className="w-full p-2 mb-4 border rounded"
                    />
                    <input
                        type="password"
                        placeholder="Password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        className="w-full p-2 mb-4 border rounded"
                    />
                    <select value={role} onChange={(e) => setRole(e.target.value)} className="w-full p-2 mb-4 border rounded">
                        <option value="user">User</option>
                        <option value="enterprise">Enterprise</option>
                    </select>
                    <button type="submit" className="w-full bg-green-500 text-white p-2 rounded">Register</button>
                </form>
            </div>
        </div>
    );
};

export default Register;
